webpackJsonp([5705136932265],{417:function(n,a){n.exports={data:{markdownRemark:{html:'<p>In 2005 <a href="https://developers.google.com/webmasters/state-of-the-web/2005/">Google sampled</a>\nover a billion documents. This highlighted popular class names,\nelements, attributes and other related metadata.</p>\n<p>The data surfaced many structural requirements related to <code class="language-text">div</code>\'s with\nclasses of <code class="language-text">nav</code>, <code class="language-text">header</code>, <code class="language-text">footer</code>, <code class="language-text">sidebar</code> etc.</p>\n<p>As HTML5 is not intended to be used to markup documents for presentation, it\nrather aims to add meaning to the elements within a document in order to\nenhance:</p>\n<ul>\n<li>accessibility,</li>\n<li>search indexing,</li>\n<li>internationalization and</li>\n<li>interoperability.</li>\n</ul>\n<p>Although the <code class="language-text">div</code> is still useful to enhance the layout of a document, the\nnewly added structural elements in HTML5 will aid the semantic structuring\nof your page.</p>\n<p><strong>Note</strong>: There are many books, articles, wikis and posts relating to these elements.\nI wanted to document my research by combining the semantics, usage and code\nsamples to act as a cheatsheet to personally use.</p>\n<h2 id="header"><a href="#header" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Header</h2>\n<p>You can use the <code class="language-text">header</code> element to group introductory content or navigational\naids.</p>\n<p>It\'s intended to contain headings but can also be used to wrap a section\'s\ntable of contents, site navigation, a search form or any relevant logos and so on.</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>header</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Alliance vs Horde<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n    Which side are you on? The Alliance or the Horde?\n    Both sides have equally captivating\n    stories to tell.\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>header</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/header">MDN Reference</a></p>\n<h2 id="footer"><a href="#footer" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Footer</h2>\n<p>You can use the <code class="language-text">footer</code> element in a document or many sections to\ncontain:</p>\n<ul>\n<li>copyright information,</li>\n<li>contact details,</li>\n<li>author details,</li>\n<li>navigational aid like a sitemap,</li>\n<li>back to the top of the page links, or</li>\n<li>related references.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>footer</span><span class="token punctuation">></span></span>\n  The content on the World of Warcraft Wiki is\n  licensed under CC-BY-SA.\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>footer</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><strong>Note</strong>: It doesn’t affect the document outline as it isn’t considered\nas sectioning content.</p>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/footer">MDN Reference</a></p>\n<h2 id="nav"><a href="#nav" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Nav</h2>\n<p>You can use the <code class="language-text">nav</code> element in your document or many sections to contain:</p>\n<ul>\n<li>site wide navigation bar containing links to other pages or sections within\na page,</li>\n<li>sections that contain additional navigation aids, and</li>\n<li>footer navigation containing common terms of service, privacy policy and\ncopyright links.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>header</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>nav</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>ul</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>History<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Alliance<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Horde<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>ul</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>nav</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>header</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/nav">MDN Reference</a></p>\n<h2 id="article"><a href="#article" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Article</h2>\n<p>You can use the <code class="language-text">article</code> element for sections of content that can be\nindependently distributed or reused such as:</p>\n<ul>\n<li>forum or blog post,</li>\n<li>article for a magazine, newspaper or online website, or</li>\n<li>content submitted by a user.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>header</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>For the Horde<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>time</span>\n        <span class="token attr-name">pubdate</span>\n        <span class="token attr-name">datetime</span><span class="token attr-value"><span class="token punctuation">=</span><span class="token punctuation">"</span>2016-06-18T08:30:00.00<span class="token punctuation">"</span></span><span class="token punctuation">></span></span>\n      <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>time</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>header</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n    The Horde is made up of Orcs, Forsaken, Tauren,\n    Trolls, Blood Elves, Goblins, and most recently,\n    Pandaren (Huojin).\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/article">MDN Reference</a></p>\n<h2 id="section"><a href="#section" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Section</h2>\n<p>You can use the <code class="language-text">section</code> element for generic sections of content that need to\nbe explicitly listed in the document outline. You can then group content based\non a theme or context such as:</p>\n<ul>\n<li>introductions,</li>\n<li>news items,</li>\n<li>contact information, and</li>\n<li>numbered sections of a thesis.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>section</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>King of the Alliance<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n      The Supreme Allied Commander of the humans, also\n      known as the king. This title is typically given\n      to a hereditary, male monarch of a nation, region\n      or state.\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>section</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>section</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Warchief of the Horde<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n    Similar to the king of the humans, the Warchief\n    is the military leader of the Orcish Horde.\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>section</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/section">MDN Reference</a></p>\n<h2 id="aside"><a href="#aside" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Aside</h2>\n<p>You can use the <code class="language-text">aside</code> element for sections of content that is seperate from\nbut relates to its surrounding content such as:</p>\n<ul>\n<li>quotes,</li>\n<li>sidebars,</li>\n<li>related articles,</li>\n<li>advertising, or</li>\n<li>navigational aid.</li>\n</ul>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>article</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Lore<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n    Blizzard\'s background story to the Warcraft\n    series of games.\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>article</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>aside</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>h1</span><span class="token punctuation">></span></span>Warcraft: The Beginning<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>h1</span><span class="token punctuation">></span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>p</span><span class="token punctuation">></span></span>\n    A movie directed by Duncan Jones, produced\n    by Legendary Pictures, and distributed by\n    Universal Pictures.\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>p</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>aside</span><span class="token punctuation">></span></span></code></pre>\n      </div>\n<p><a href="https://developer.mozilla.org/en/docs/Web/HTML/Element/aside">MDN Reference</a></p>\n<h2 id="compatibility"><a href="#compatibility" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Compatibility</h2>\n<p>Browsers that don\'t support the new elements will render them as a <code class="language-text">span</code>. If\nyou want to enforce compatibility with legacy browsers you can style\nthese elements in CSS to be block-level elements.</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code class="language-css"><span class="token selector">article, section, aside, nav, header, footer</span> <span class="token punctuation">{</span>\n  <span class="token property">display</span><span class="token punctuation">:</span> block<span class="token punctuation">;</span>\n<span class="token punctuation">}</span></code></pre>\n      </div>\n<p>Unfortunately some legacy browsers don\'t apply styling to unknown elements.\nIf you need to support them, you could reference the\n<a href="https://github.com/aFarkas/html5shiv">HTML5 Shiv JavaScript</a>\nfor display and printing of your documents.</p>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code class="language-html"><span class="token comment">&lt;!--[if lt IE 9]>\n  &lt;script src="html5shiv.js">&lt;/script>\n&lt;![endif]--></span></code></pre>\n      </div>\n<h2 id="my-final-thoughts"><a href="#my-final-thoughts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>My final thoughts</h2>\n<p>When I tested the document outline of my blog I realized that I have been\nusing these elements incorrectly as they provided little to no and often\nincorrect meaning to the structure of my documents. It\'s amazing what a bit of\nresearch can teach you.</p>\n<p>You can test the structure of your documents using Document Outline tools.\nUnfortunately I cannot vouch for the correctness of the tools provided below.</p>\n<ul>\n<li><a href="https://gsnedders.html5.org">Online tester</a> by gsnedders</li>\n<li>HTML5 Outliner <a href="https://chrome.google.com/webstore/detail/html5-outliner/afoibpobokebhgfnknfndkgemglggomo?hl=en">Chrome Extension</a>\nby Dominykas Blyžė</li>\n<li>HTML5 Outliner <a href="https://addons.mozilla.org/en-US/firefox/addon/html5_outliner/">Firefox Extension</a>\nby arky</li>\n</ul>\n<p>It can be tricky to know what to use and when.\n<a href="http://html5doctor.com">HTML5 Doctor</a> has a great\nflowchart to help save time when making these decisions. They provide an\n"easy-to-understand HTML5 sectioning element flowchart to\nhelp you get to grips with some of the new elements in HTML5."</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/html5-doctor-flowchart-f399b8b5ddb598a303ee91cfbe177bf7-0f6f8.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 409px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.17114914425427%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Analogy"\n        title="HTML5 Sectioning Flowchart"\n        src="/static/html5-doctor-flowchart-f399b8b5ddb598a303ee91cfbe177bf7-0f6f8.jpg"\n        srcset="/static/html5-doctor-flowchart-f399b8b5ddb598a303ee91cfbe177bf7-0ff21.jpg 173w,\n/static/html5-doctor-flowchart-f399b8b5ddb598a303ee91cfbe177bf7-15fca.jpg 345w,\n/static/html5-doctor-flowchart-f399b8b5ddb598a303ee91cfbe177bf7-0f6f8.jpg 409w"\n        sizes="(max-width: 409px) 100vw, 409px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: <a href="http://html5doctor.com/downloads/h5d-sectioning-flowchart.pdf">HTML5 Doctor</a></em></p>\n<hr>\n<h2 id="references"><a href="#references" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>References</h2>\n<ul>\n<li><a href="https://www.w3.org/wiki/HTML_structural_elements">W3.org Wiki</a></li>\n<li>A Book Apart: <a href="https://abookapart.com/products/html5-for-web-designers">HTML5 for web designers</a>\nby Jeremy Keith</li>\n<li><a href="http://html5doctor.com/lets-talk-about-semantics/">Let\'s Talk about Semantics</a>\nby HTML5 Doctor</li>\n<li><a href="https://www.smashingmagazine.com/2011/11/html5-semantics/">HTML5 Semantics</a>\nby Bruce Lawson at Smashing Magazine</li>\n<li><a href="http://wowwiki.wikia.com/">World of Warcraft</a> references used in examples</li>\n</ul>',timeToRead:6,excerpt:"In 2005  Google sampled \nover a billion documents. This highlighted popular class names,\nelements, attributes and other related metadata…",frontmatter:{title:"HTML5 structural semantics",cover:"https://picsum.photos/1280/500/?image=36",date:"2016-06-17 12:02:38 +0200",category:null,tags:["Technical"]},fields:{slug:"/blog/html-5-structural-semantics"}},prev:{excerpt:"The HTML5 specification has introduced more elements to aid us with\nsemantic markup. I've discussed some of the…",frontmatter:{title:"Some new HTML5 elements",cover:"https://picsum.photos/1280/500/?image=526",date:"2016-06-18 13:26:44 +0200"},fields:{slug:"/blog/some-new-html-5-elements"}},next:{excerpt:"Elements, attributes, and attribute values are semantic according to the\nHTML5 Specification. These definitions…",frontmatter:{title:"Design changes in HTML5",cover:"https://picsum.photos/1280/500/?image=20",date:"2016-06-16 10:00:00 +0200"},fields:{slug:"/blog/design-changes-in-html-5"}}},pathContext:{slug:"/blog/html-5-structural-semantics",total:57,prev:"/blog/some-new-html-5-elements",next:"/blog/design-changes-in-html-5"}}}});
